import React from 'react';
import './App.css';

function Footer () {
  return (
    <div className="dogfair-footer">
      Icons made by&nbsp;
      <a href="https://www.flaticon.com/authors/freepik" title="Freepik">
        Freepik
      </a>
      &nbsp;from&nbsp;
      <a href="https://www.flaticon.com/" title="Flaticon">
        www.flaticon.com
      </a>
      .
    </div>
  );
}

export default Footer;
